import React from 'react';
import Completed from '../../assets/images/completed.svg';
import Current from '../../assets/images/current-level.svg';
import Locked from '../../assets/images/locked.svg';

function LevelItem({ level, currentLevel }) {
    const isCompleted = level.id <= currentLevel;
    const isCurrent = level.id == currentLevel;
    // console.log(level.id);
    console.log(level.id + ' == ' + currentLevel + ': ', level.id == currentLevel);
    const levelStatus = () => {
        if (isCompleted) {
            return 'completed';
        } else if (isCurrent) {
            return 'current ring-4 ring-offset-4 ring-gray-400';
        } else {
            return 'locked';
        }
    };

    return (
        <li className="mt-5">
            <a href='/Game' className={`level-path-btn mx-2 ${levelStatus()}`}>
                <img src={isCompleted ? Completed : isCurrent ? Current : Locked} className='size-14'/>
            </a>
        </li>
    );
}

export default LevelItem;
